import "./SCSSContainer.css";

const SCSSContainer = () => {
  return (
    <div className="div26">
      <b className="best-scss-for">Best SCSS for you</b>
      <div className="add-more-scss">
        Add more SCSS to your Instagram or Tiktok Bio and optimize your traffic.
        And shorten the URL and custom QR code.
      </div>
      <div className="div27">
        <button className="a2">
          <div className="create-now">CREATE NOW</div>
        </button>
        <button className="a3">
          <div className="sample-scss">SAMPLE SCSS</div>
          <img className="frame-icon11" alt="" src="/frame2.svg" />
        </button>
      </div>
    </div>
  );
};

export default SCSSContainer;
